window.bookSummaryJSON = "<p>With <i>Submerged,</i> Dani Pettrey kicks off a thrilling series that is winning the author fans everywhere. When her aunt dies in a mysterious plane crash, Professor Bailey Craig returns to Yancey, Alaska. She soon learns that her expertise is desperately needed in the investigation of a string of local murders—so she works with her ex, Cole McKenna, to ferret out the truth. As they become reacquainted, old feelings rekindle—but do Bailey and Cole have a future together?</p>"; 
